using NumVec = std::vector<int>;

void print(NumVec &vec)
{
    for (int num : vec) {
        std::cout << num << " ";
    }
    std::cout << std::endl;
}

void bubbleSort(NumVec &vec)
{
    for (int i = 0; i < vec.size() - 1; i++) {
        for (int j = i + 1; j < vec.size(); j++) {
            if (vec[i] > vec[j]) {
                int t = vec[i];
                vec[i] = vec[j];
                vec[j] = t;
            }
        }
    }
}

